import './About.css';

const About = () => {
    return(
        <div className='about'>
            <div className='container'>
                <h2 className='section-title'>About Me</h2>
                <p className='section-description'>
                    Hello,  and I am currently a senior at Rutgers University New Brunswick.
                </p>
            </div>
        </div>
    );
}

export default About;
